    const [project , setProject] =useState([]);
    let id = useParams();

    const filterProject = () => {
        projects.filter(function(e){
            if(id === e.link) {
                console.log(e);
            }

        })
    }

    filterProject()

    useEffect(()=>{
        console.log(projects);
    },[])
